import React from 'react';
import UserLoginPage from './Pages/UserLoginPage';
import { BrowserRouter, Route } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <Route path='/' render={() => <UserLoginPage/>}/>
    </BrowserRouter>
  );
}

export default App;
